tables.table_schema:
CREATE TABLE patient_compliance_data (
	patient_id INT,
	adherence_level FLOAT,
	treatment_outcome VARCHAR(255)
);

CREATE TABLE patient_data (
  patient_id INT,
  drug_name VARCHAR,
  adherence_level VARCHAR,
  treatment_outcome VARCHAR
);

CREATE TABLE patient_demographics (
  patient_id INT,
  age INT,
  gender VARCHAR,
  city VARCHAR
);

CREATE TABLE treatment_schedule (
  treatment_id INT,
  drug_name VARCHAR,
  dosage VARCHAR,
  schedule_time TIME
);

CREATE TABLE Treatments (
    treatment_id SERIAL PRIMARY KEY,
    treatment_name VARCHAR(50) NOT NULL,
    start_date DATE,
    end_date DATE
);

CREATE TABLE Outcomes (
    outcome_id SERIAL PRIMARY KEY,
    treatment_id INT REFERENCES Treatments(treatment_id),
    outcome_description TEXT
);

CREATE TABLE PatientData (
  patient_id INT,
  adherence_level VARCHAR,
  treatment_outcome VARCHAR,
  treatment_duration INT
);

CREATE TABLE AdherenceLevels (
  level_id INT,
  adherence_description VARCHAR
);

CREATE TABLE TreatmentOutcomes (
  outcome_id INT,
  outcome_description VARCHAR
);

CREATE TABLE Treatments (
  treatment_id INT,
  treatment_name VARCHAR,
  treatment_duration INT
);

CREATE TABLE Patients (
  patient_id INT,
  patient_name VARCHAR,
  age INT,
  gender VARCHAR
);
